import { useSelector } from "react-redux"
import { useState } from "react"
import styles from './PostGame.module.css'


const validateGameName = (form,error,setError) => {
    if(!form.name) {setError({...error, name: 'This field is obligatory'})}
    else {
        if(form.name.length >= 30) {setError({...error, name: 'Max Characters : 30'})}
        else {
            setError({...error, name: ''})
        }
    }
}

const validateDescription =  (form,error,setError) => {
    if(!form.description) {setError({...error, description: 'This field is obligatory'})}
    else {
        if(form.description.length > 1000) setError({...error, description: 'Max characters: 1000'})
        else {
            setError({...error, description: ''})
        }
    }
}

function PostGame(){
    const [form, setForm ]= useState({
        name: '',  
        description: '',
        released: '',
        metacritic: '',
        image_one:'',
        platforms:'',
        stores: '',
        developer: '',
        genres: '',
        tags:''
    })

    const [error, setError] = useState({
        name: '',  
        description: '',
        released: '',
        metacritic: '',
        image_one:'',
        platforms:'',
        stores: '',
        developer: '',
        genres: '',
        tags:''
    })

    function handleChange(event){
        const property = event.target.name;
        const value = event.target.value
        setForm({...form, [property]: value})
        switch(property){
            case 'name':
                return validateGameName({...form, [property]: value}, error, setError)
            case 'description': 
                return validateDescription({...form, [property]: value}, error, setError)
        }
    }

    return(
        <form>
            <div className={styles.container}>
                <label className={styles.labels} htmlFor="name">Name your game: </label>
                <input className={styles.inputs}type='text' value={form?.name} name='name' onChange={handleChange}></input>
                <span>{error.name}</span>
                <label htmlFor='description'>Description: </label>
                <textarea name='description' value={form.description} onChange={handleChange}></textarea>
                <span>{error.description}</span>
                <label htmlFor='release'>This will fill automatically</label>
                <input type='date' name='release' onChange={handleChange}></input>
                <label htmlFor='image'>Url image of the game: </label>
                <input type='url' name='image' onChange={handleChange} value={form.image_one}></input>
                <label htmlFor='rating'>This will Start on 0</label>
                <input type='number' name='rating' onChange={handleChange}/>
                <label htmlFor='playtime'>Aprox time of play: </label>
                <input type='number' name='playtime' onChange={handleChange}></input>
                <label htmlFor='stores'>Where can we buy it? </label>
                <input type='text' name='stores' value={form.stores} onChange={handleChange}></input>
                <label htmlFor='developer'>Developer or company name: </label>
                <input type='text' value={form.developer} name='developer' onChange={handleChange}></input>
                <label htmlFor='genres'>Genres of your game: </label>
                <input type='text' value={form.genres} onChange={handleChange}></input>
                <label htmlFor='tags'>Add some tags!</label>
                <input type='text' onChange={handleChange}></input>
            </div>
           
        </form>
    )
}

export default PostGame
